// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "./Land.sol";

contract LTC is ERC20 {
	uint public TOTAL_SUPPLY;
	LAND private land;

	mapping(address => mapping(uint => uint)) private lastMint;
	mapping(address => mapping(uint => uint)) private claimedSoFar;
	mapping(uint => uint) private rewardAmt;

	uint private eStart = 5;
	uint private eEnd = 7;

	constructor(LAND _land) ERC20("MetaLTC", "mLTC") {
		land = _land;
		TOTAL_SUPPLY = 84000000 * 10 ** 18;

		// Daily Rewards
		rewardAmt[5] = 0.25 ether;
		rewardAmt[6] = 0.5 ether;
		rewardAmt[7] = 1 ether;
	}

	function rewardData(address addr, uint eType) public view returns (uint[] memory) {
		require(eType >= eStart);
		require(eType <= eEnd);

		uint reward = rewardAmt[eType] * land.eqCount(addr, eType);
		if (block.timestamp - lastMint[addr][eType] < 1 days) reward = 0;
		if (block.timestamp - land.latestInstall(addr, eType) < 1 days) reward = 0;

		uint[] memory arr = new uint[](2);
		arr[0] = claimedSoFar[addr][eType];
		arr[1] = reward;

		return arr;
	}

	function claimReward(uint eType) public {
		require(eType >= eStart);
		require(eType <= eEnd);

		require(block.timestamp - lastMint[msg.sender][eType] > 1 days, "You can claim rewards once a day");
		require(block.timestamp - land.latestInstall(msg.sender, eType) > 1 days, "You must wait 24 hours after latest installation");

		uint reward = rewardAmt[eType] * land.eqCount(msg.sender, eType);

		_mint(msg.sender, reward);
		claimedSoFar[msg.sender][eType] += reward;
		lastMint[msg.sender][eType] = block.timestamp;
	}
}
